import React from 'react';
import {Link} from 'react-router-dom';
import Logo from '.'

function Navbar (){
    return(
        <>
        <div className='Navbar'>
        <div className="leftside"><img src="https://img.freepik.com/premium-vector/pizza-logo-design_9845-319.jpg?w=2000"/> </div>
        <div className="rightside">
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        <Link to="/">Home</Link>
        
        </div>
        </div>
        
     
       
        
        </>
    )
}


export  default Navbar ;
